class s extends Component {
    timer;
  
    sendMessage = (e) => {
      e.preventDefault();
      this.timer = setTimeout(() => alert('Hey ??'), 1000);
    }
  
    componentWillUnmount() {
      clearTimeout(this.timer);
    }
  
    render() {
      return (
        <button onClick={this.sendMessage}>
          Send message
        </button>
      );
    }
  }
